Let me think through this step by step...

The previous models explore variations of self-interest and fairness considerations.  However, they lack a model that explicitly incorporates the *relative* contribution of the two players and how this might influence the perception of fairness. A responder might be more tolerant of an unequal split if their contribution was significantly larger than the opponent's.  Conversely, a small contribution might make a responder more sensitive to even minor inequities. This model will focus on these aspects and maintain parameter parsimony.

This model proposes that the utility of accepting an offer is a function of the received monetary amount (`split_self`) modulated by a sensitivity to relative contribution and a sensitivity to proportional inequity.  The relative contribution is simply the ratio of the responder's tokens to the total tokens.  Proportional inequity is the difference between the responder's percentage share and their proportional contribution to the total tokens.

The mathematical form will be a weighted sum of these two factors.  This avoids the problem of high covariance among parameters by having one parameter directly influence the perceived benefit of the money, and one parameter directly influencing the perception of the fairness.

The model will have two learnable parameters:

1.  `contribution_sensitivity`: This parameter captures how much the responder weighs their relative contribution to the overall pot. Higher values indicate greater sensitivity to their relative contribution.

2.  `inequity_sensitivity`: This parameter reflects the responder's aversion to proportional inequity. Higher values indicate greater aversion to unequal splits relative to contribution.


<MODEL>
U_accept = contribution_sensitivity * (split_self / (token_self + token_opp)) * token_self + inequity_sensitivity * (splitperc_self - (token_self / (token_self + token_opp)) * 100)
</MODEL>

